  \"lake-andes-national-wildlife-refuge-annual-narrative-report-calendar-year-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lake Andes
  NWR, Karl Mundt NWR, and Lake Andes WMD outlines Refuge accomplishments during the
  1992 calendar year. The report begins with a summary of the year's highlights and
  weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, funding, and safety is given. Habitat
  management is also covered; subjects include wetlands, forests, croplands, grasslands,
  grazing, haying, fire management, pest control, water rights, WPA easements, and
  private lands. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, fisheries resources, animal control, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, wildlife observation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, and computer systems. Cooperative programs and items of interest are provided
  at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
